(6372, 25, '2018-10-25 16:23:11', '2018-10-25', '15:57', '1515H Sir Michael Sun from Ceneco called to Nominate interval 1800H-2100H (4hrs) @ 18.9MW (Unit 1-4). 1528H Called Plant Operations, informed Ms Beverly that Ceneco nominated interval 1800H-2100H (4hrs) @ 18.9MW (Unit 1-4). 1530H Ms Rebecca called to verify the nomination of Ceneco. 1531H Sir Michael Dacutan of Ceneco called to inform again that they will nominate interval 1800H-2100H @ 18.9MW (Unit 1-4). 1533H Submit Revision 1 for Unit 2 and Revision 2 Bids and Offers for Unit 1, 3 & 4 to WESM. 1535H Sir Michael Sun call back to cancel nomination. 1536H Informed Ms Rebecca that Ceneco cancelled their nomination. 1539H Submit Revision 2 for Unit 2 and Revision 3 Bids and Offers for Unit 1, 3 & 4 to WESM. 1557H Informed Ms Regina No Dispatch Interval 1700H.'),
