(6375, 25, '2018-10-25 18:04:05', '2018-10-25', '17:00', '1658H Informed Ms Regina with Dispatch Interval 1800H, Full Load, Unit 1-3 @ 4.2MW and Unit 4 @ 6.4MW. 1700H Ms Regina call back again to verify if all units will run, including unit 2. 1701H Called Sir Michael Dacutan from Ceneco but he hang up. 1702H Sir Michael Dacutan call back, so we asked him if they would like to revised their nomination since the price now for interval 1800H is at P 32 but Sir Michael Dacutan says, they already called to inform us that they will cancel their nomination for interval 1800H-2100H. Ms Daisy explained it further to him, a while ago it is already clear to us that Ceneco cancelled their nomination for interval 1800H-2100H but we would like to ask if you might nominate starting from interval 2000H since the price for interval 1800H suddenly rise up at P 32. But Sir Michael Dacutan still persist not to nominate since the needed supply is no longer that big and they still cannot nominate for one hour only. 1753H Ms Regina called that Unit 2 was not able to cut in. 1758H Informed MS Regina No RTD for Interval 1900H, she also informed that they will declare Unit 2 FOH for Interval 1800H-2400H but open market is starting interval 2100H already, revision of load dispatch to follow.'),
