(16573, 25, '2019-07-08 19:14:26', '2019-07-08', '18:13', '1828H Ms Regina message @gmail reason for Unit 5 unable to cut-in. DG5 set normal shutdown at 1525H due to failure to increase/decrease engine speed. For replacement of governor servomotor speed adjusting rheostat.  1845H Ms Regina called to inform that they are instructed by SO to run MRU Interval 1900H Unit 1 @ 4.2MW and Unit 4 @ 6.4MW. 1853H Ms Regina called to inform that NGCP advised to run only one unit. So they let Unit 2 run @ 4.2MW. 1858H Informed Ms Beverly No RTD Interval 2000H.1906H Ms Regina called to iform that reason for MRU run is due to system voltage requirement. 1911H Ms Regina called to inform that they already cut out unit 2 as per advised by SO.'),
